import styles from "../assets/styles/homepage.css"
import roles from  "../assets/json/myRoles.json"


const Index = () => {
    let role = "No Information";
    if(roles.roles) role = roles.roles[Math.floor(Math.random()*myArray.length)];
    return (
            <main className="main">
                <div>
                    <h1>Raghav Sharma</h1>
                    <div className="role">I am {role}</div>
                </div>
            </main>);
}

export default Index;
